{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/odwaters/kidney-failure-prediction-1-clean-impute?scriptVersionId=133723014\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"raw","id":"dd07036a","metadata":{"papermill":{"duration":0.009305,"end_time":"2023-06-15T19:14:40.640972","exception":false,"start_time":"2023-06-15T19:14:40.631667","status":"completed"},"tags":[]},"source":["## Purpose of the project\n","\n","I am interested in this prediction model because I am passionate about diet, fitness, health and wellness behaviors. Polycyctic Kidney Disease (PKD) also runs in my family. There is a huge uptick in kidney failure as a whole through the United States and I would like to see what factors cause how likely people are to have to go into dialysis or transplant. Being able to use demographic data, lab reports, and possibly dietary information to create a prediction model could be useful for further research into one of the topics. Also I hope to use my own information from a recent medical physical in the model that has the strongest power/prediction to see my own liklihood of kidney failure that will be confirmed by ultrasound by a healthcare professional as well. In this first section of the model I used articles on kidney failure and health modalities to select apporpriate features for the prediction. First I take the whole data and clean/transform it to be usable in a prediction model, then I impute the missing values. Once the data is completed I measured correlates between the vaules to look for over-inflated correlations in the matrix. Then measure my selected features against each other with multiple linear regression to check for variance and rank importance to limit the selection. Finally I use Recursive Feature Selection to check the prediction power of the remaining features. The remaining features and my kidney-failure factor was printed to a .csv dataset- fully cleaned, imputed, and restricted to a set of 11 features for prediction. The next notebook will go over splitting and modeling the data to check different bagging/boosting methods. (This prediction will show if someone is likley to be currently experiencing kidney failure not an estimate of future failure).\n","\n","## Data\n","\n","\n","#### Where does the data come from?\n","\n","(Data card information) The National Health and Nutrition Examination Survey (NHANES) is a program of studies designed to assess the health and nutritional status of adults and children in the United States. The survey is unique in that it combines interviews and physical examinations. NHANES is a major program of the National Center for Health Statistics (NCHS). NCHS is part of the Centers for Disease Control and Prevention (CDC) and has the responsibility for producing vital and health statistics for the Nation.\n","\n","The NHANES program began in the early 1960s and has been conducted as a series of surveys focusing on different population groups or health topics. In 1999, the survey became a continuous program that has a changing focus on a variety of health and nutrition measurements to meet emerging needs. The survey examines a nationally representative sample of about 5,000 persons each year. These persons are located in counties across the country, 15 of which are visited each year.\n","\n","The NHANES interview includes demographic, socioeconomic, dietary, and health-related questions. The examination component consists of medical, dental, and physiological measurements, as well as laboratory tests administered by highly trained medical personnel.\n","\n","#### What does each table hold?\n","\n","Demographics dataset:\n","A complete variable dictionary can be found at the dataset entry, but is self-explainatory for any foundational knowledge in demographics: (https://wwwn.cdc.gov/Nchs/Nhanes/Search/variablelist.aspx?Component=Demographics&CycleBeginYear=2013)\n","\n","Examinations dataset, which contains:\n","* Blood pressure\n","\n","* Body measures\n","\n","* Muscle strength - grip test\n","\n","* Oral health - dentition\n","\n","* Taste & smell\n","\n","Dietary data - total nutrient intake, first day:\n","A complete variable dictionary can be found here(https://wwwn.cdc.gov/Nchs/Nhanes/Search/variablelist.aspx?Component=Examination&CycleBeginYear=2013)\n","\n","Laboratory dataset, which includes:\n","* Albumin & Creatinine - Urine\n","\n","* Cholesterol - HDL\n","\n","* Cholesterol - LDL & Triglycerides\n","\n","* Cholesterol - Total\n","\n","* Complete Blood Count with 5-part Differential - Whole Blood\n","\n","* Copper, Selenium & Zinc - Serum\n","\n","* Fasting Questionnaire\n","\n","* Polycyclic Aromatic Hydrocarbons (PAH) - Urine\n","\n","* Urinary Mercury\n","\n","* Urinary Speciated Arsenics\n","\n","* Urinary Total Arsenic\n","\n","* Urine Flow Rate\n","\n","* Urine Metals\n","\n","* Urine Pregnancy Test\n","\n","* Vitamin B12\n","\n","A complete data dictionary can be found here (https://wwwn.cdc.gov/Nchs/Nhanes/Search/variablelist.aspx?Component=Laboratory&CycleBeginYear=2013)\n","\n","Questionnaire dataset, which includes information on:\n","\n","* Alcohol Use\n","\n","* Blood Pressure & Cholesterol\n","\n","* Cardiovascular Health\n","\n","* Weight History\n","\n","* Weight History - Youth\n","\n","A complete variable dictionary can be found here(https://wwwn.cdc.gov/Nchs/Nhanes/Search/variablelist.aspx?Component=Questionnaire&CycleBeginYear=2013)\n","\n","Medication dataset, which includes prescription medications:\n","A complete variable dictionary can be found here: (https://wwwn.cdc.gov/Nchs/Nhanes/Search/variablelist.aspx?Component=Questionnaire&CycleBeginYear=2013)\n","\n","\n","#### Processing of the Data\n","\n","I chose to use R as I am comfortable with the packages. Python seems to have a faster processing speed for a lot of the manipulations we use here. Namely mice, mlbench, and caret packages do not run very well in this IDE and shoots runtime for the notebook up to close to an hour on my laptop. We use mice for imputation of the missing data values as every participant would be removed if we simply listwise deleted NA's. mlbench and caret are used for their modeling to compare the features at the end of the notebook. in total the packages used are:\n","\n","library(tidyverse)\n","library(janitor)\n","library(ggplot2)\n","library(dplyr)\n","library(lubridate)\n","library(skimr)\n","library(readr) read in .csv\n","library(mice) impuatation of the data\n","library(foreign) to add the kidney data from a SAS type .xpt file\n","library(mlbench) to model the mutiple linear regressions faster than base package\n","library(caret) to create and compare the indiviual models\n","\n","#### First we need to get the useful initial libraries\n","\n","The libraries used will be for analyzing, transforming, cleaning, and manipulating the data- skimr, tidyverse, janitor, dplyr, ggplot2, lubridate, readr"]},{"cell_type":"code","execution_count":1,"id":"242eb1d3","metadata":{"execution":{"iopub.execute_input":"2023-06-15T19:14:40.659192Z","iopub.status.busy":"2023-06-15T19:14:40.65722Z","iopub.status.idle":"2023-06-15T19:15:32.375415Z","shell.execute_reply":"2023-06-15T19:15:32.373763Z"},"papermill":{"duration":51.736056,"end_time":"2023-06-15T19:15:32.384359","exception":false,"start_time":"2023-06-15T19:14:40.648303","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.5 \n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b[32m