"<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n","</style>\n","<ol class=list-inline><li>20194</li><li>13</li></ol>\n"],"text/latex":["\\begin{enumerate*}\n","\\item 20194\n","\\item 13\n","\\end{enumerate*}\n"],"text/markdown":["1. 20194\n","2. 13\n","\n","\n"],"text/plain":["[1] 20194    13"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n","</style>\n","<ol class=list-inline><li>10175</li><li>953</li></ol>\n"],"text/latex":["\\begin{enumerate*}\n","\\item 10175\n","\\item 953\n","\\end{enumerate*}\n"],"text/markdown":["1. 10175\n","2. 953\n","\n","\n"],"text/plain":["[1] 10175   953"]},"metadata":{},"output_type":"display_data"}],"source":["head(demo)\n","glimpse(demo)\n","\n","head(diet)\n","glimpse(diet)\n","\n","head(exam)\n","glimpse(exam)\n","\n","head(labs)\n","glimpse(labs)\n","\n","head(meds)\n","glimpse(meds)\n","\n","head(surveysays)\n","glimpse(surveysays)\n","\n","dim(demo)\n","dim(diet)\n","dim(exam)\n","dim(labs)\n","dim(meds)\n","dim(surveysays)"]},{"cell_type":"markdown","id":"19d91fd1","metadata":{"papermill":{"duration":0.015407,"end_time":"2023-06-15T19:15:40.232552","exception":false,"start_time":"2023-06-15T19:15:40.217145","status":"completed"},"tags":[]},"source":["I notice the majority of the data is in int and dbl format. There are a lot of NA's which is expected as not every patient will qulify for every examination or test (Missing Not At Random data)- so it is still useful information as a negative feedback. \n","\n","The headers are a bit confusing with the short hand they chose to format the long data in. But when I open the files in Excel it has a description of each of the columns available. There are also links available at the data card that describe each column. So I will need to do quite a bit of transformation and verification of the data before it is understandable to me to be able to relay to a stakeholder.\n","\n","As you can see this is an absolutely massive and complex dataset. I have no formal medical training and am not really interested in how various medications are used on a per person basis. So I will not be manipulating the medication set. I will also only use a few pop culture measures from the labs as I do have a strong background in biology and understand lab reports can be multi faceted. There are various outcomes of high or low readings according to symptomology, which without an EDA and no clear direction, would not be useful. They could also be potentially misleading. The majority of my data used will come from the demographics, examinations, and diet datasets. The questionaire portion will be useful towards the end when I have more insight into the sample population tested.\n","\n","#### Checking ID's\n","\n","My plan initially was to open the files in excel and create pivot tables. However, this dataset has so many enteries that my excel will not handle it appropriatley so, all analysis will take place within the notebook.\n","\n","\n"]},{"cell_type":"code","execution_count":4,"id":"e7e7cbf6","metadata":{"execution":{"iopub.execute_input":"2023-06-15T19:15:40.266656Z","iopub.status.busy":"2023-06-15T19:15:40.265093Z","iopub.status.idle":"2023-06-15T19:15:40.308123Z","shell.execute_reply":"2023-06-15T19:15:40.306059Z"},"papermill":{"duration":0.063221,"end_time":"2023-06-15T19:15:40.311111","exception":false,"start_time":"2023-06-15T19:15:40.24789","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["10175"],"text/latex":["10175"],"text/markdown":["10175"],"text/plain":["[1] 10175"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["9813"],"text/latex":["9813"],"text/markdown":["98