          2             2           \n","10169 NA         NA            NA           \n","10170 NA          2             2           \n","10171 13          2             2           \n","10172 NA         NA            NA           \n","10173 10          2             2           \n","10174 NA         NA            NA           \n","10175 NA         NA            NA           "]},"metadata":{},"output_type":"display_data"}],"source":["kid_pred <- subset(kid_pred, select = -c(stones, education))\n","\n","kid_pred"]},{"cell_type":"raw","id":"c8b55616","metadata":{"papermill":{"duration":0.021515,"end_time":"2023-06-15T19:15:54.534553","exception":false,"start_time":"2023-06-15T19:15:54.513038","status":"completed"},"tags":[]},"source":["## Imputation of NA's\n","\n","Since we can see there are quite a few missing values within this dataframe it is important to fill these values with various means (not Means necessarily) to fill the set and let the algorithm do its job.\n","\n","* We start with a normal fill for the data I would not assume has much variance (majority of people haven't experinced kidney stones so, many 0's, householdincome was not reported on often so next fill will suffice)\n","\n","* I use the median function to fill the variables that should follow a normal distribution according to the sampling of the data at 9,800 participants I think this is a good approach. Then median again for the caffiene, niacin, protein as they will vary widely and getting a better middling-distribution is key.\n","\n","* Then I wrote a function to calculate mode and impute race, race2, and water consumption as this is an american survey and the majority of the participants will be non-hispanic, white. Water consumption could have been better with a mean imputation but I think mode is more appropriate as there are not many options for the amount of water consumed in a day and the most answered will probably align with the population better.\n","\n","* Finally I use Predictive Means Matching from the already imputed values to estimate the hard hitting features.  \n","\n","For solid prediction models in an industry setting PMM or KNN should be used to impute if you cannot drop the NA values. Standard mean is the go-to lazy way just to get a model moving. I used a combination of methods just to get used to the various types of data fill. Each fill has strengths and weaknesses according to how the data is missing- missing at random, missing not at random, or missing completely at random. Before imputing your data I would read up on the various missing data types to best serve your model."]},{"cell_type":"code","execution_count":12,"id":"0cfdef0e","metadata":{"execution":{"iopub.execute_input":"2023-06-15T19:15:54.578703Z","iopub.status.busy":"2023-06-15T19:15:54.577112Z","iopub.status.idle":"2023-06-15T19:16:08.230878Z","shell.execute_reply":"2023-06-15T19:16:08.228155Z"},"papermill":{"duration":13.678745,"end_time":"2023-06-15T19:16:08.233385","exception":false,"start_time":"2023-06-15T19:15:54.55464","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["\n"," iter imp variable\n","  1   1  creatinine  urinecreatinine  uacr  bloodnitro  failingkidney\n","  1   2  creatinine  urinecreatinine  uacr  bloodnitro  failingkidney\n","  1   3  creatinine  urinecreatinine  uacr  bloodnitro  failingkidney\n","  1   4  creatinine  urinecreatinine  uacr  bloodnitro  failingkidney\n","  1   5  creatinine  urinecreatinine  uacr  bloodnitro  failingkidney\n","  2   1  creatinine  urinecreatinine  uacr  bloodnitro  failingkidney\n","  2   2  creatinine  urinecreatinine  uacr  bloodnitro  failingkidney\n","  2   3  creatinine  urinecreatinine  uacr  bloodnitro  failingkidney\n","  2   4  creatinine  urinecreatinine  uacr  bloodnitro  failingkidney\n","  2   5  creatinine  urinecreatinine  uacr  bloodnitro  failingkidney\n","  3   1  creatinine  urinecreatinine  uacr  bloodnitro  failingkidney\n","  3   2  creatinine 