                 mode(water), \n","                         water))\n","\n","## set all Na's in time_in_us to 0 as that indicates they are probably american, then anything not 0 will be 1 for non-american\n","kid_pred$time_in_us[is.na(kid_pred$time_in_us)] <- 0\n","kid_pred$time_in_us[kid_pred$time_in_us != 0] <- 1\n","\n","## kidney has 8 answers of IDK to failing kidneys- I think it would be better to estimate from an NA and then manipulate according to the surroudning features PMM\n","kid_pred$failingkidney[kid_pred$failingkidney == 9] <- NA\n","\n","\n","## set.seed to abritrary value so we can repeat test\n","set.seed(69420)\n","\n","## run predictive means measure for creatinine, urinecratinine, Urine Albumin-Creatinine Ratio, bloodnitrogen, and failing kidneys\n","itr_imp <- mice(kid_pred, m = 5, method = c(\"\", \"\", \"\", \"\", \"\", \"\", \"\", \"\", \"\", \"\", \"\", \"\", \"\", \"pmm\", \"pmm\", \"pmm\", \"\", \"pmm\", \"pmm\", \"\"), maxit = 10)\n","\n","## now summarize the datasets so I can choose one that follows a similar curve. \n","## Through my research into kidney failure creatinine will be a strong predictor \n","## so I want to base the set off of its summary mean\n","summary(kid_pred$creatinine)\n","\n","itr_imp$imp$creatinine"]},{"cell_type":"markdown","id":"916f4a3c","metadata":{"papermill":{"duration":0.021106,"end_time":"2023-06-15T19:16:08.275761","exception":false,"start_time":"2023-06-15T19:16:08.254655","status":"completed"},"tags":[]},"source":["## Cleaned data\n","\n","From this output the dataset I'm going with is set 1. It seems to hover around the mean/ median of the initial set and has a high variance without throwing super low and high values to adjust mean like set 3 does. I think it will fit the test set and train well for our purposes."]},{"cell_type":"code","execution_count":13,"id":"8403908e","metadata":{"execution":{"iopub.execute_input":"2023-06-15T19:16:08.321532Z","iopub.status.busy":"2023-06-15T19:16:08.319996Z","iop