n function\n","control <- rfeControl(functions=rfFuncs, method=\"cv\", number=10)\n","# run the RFE algorithm\n","results <- rfe(prediction_ds[,1:11], prediction_ds[,12], sizes=c(1:11), rfeControl=control)\n","# summarize the results\n","print(results)\n","# list the chosen features\n","predictors(results)\n","# plot the results\n","plot(results, type=c(\"g\", \"o\"))"]},{"cell_type":"markdown","id":"f061c17f","metadata":{"papermill":{"duration":0.026417,"end_time":"2023-06-15T19:38:51.443901","exception":false,"start_time":"2023-06-15T19:38:51.417484","status":"completed"},"tags":[]},"source":["This Recursion is saying that Creatinine, bloodnitrogen, age, diastolyic blood pressure, and urinecreatinine are the strongest predictiors for the model and adding more features can cause a detriment to prediction power. However, looking at the scale of analysis it is all within 97-98% and adding weaker predictors for their variance will be beneficial to the final model. So, we will keep all 11 predictors for the next steps of the process. So, lets offload a .csv of the complete data and move notebooks...."]},{"cell_type":"code","execution_count":18,"id":"74aa3909","metadata":{"execution":{"iopub.execute_input":"2023-06-15T19:38:51.498538Z","iopub.status.busy":"2023-06-15T19:38:51.496954Z","iopub.status.idle":"2023-06-15T19:38:51.590518Z","shell.execute_reply":"2023-06-15T19:38:51.588708Z"},"papermill":{"duration":0.123002,"end_time":"2023-06-15T19:38:51.593128","exception":false,"start_time":"2023-06-15T19:38:51.470126","status":"completed"},"tags":[]},"outputs":[],"source":["write.csv(prediction_ds, file =\"kid_pred_ds.csv\")"]},{"cell_type":"markdown","id":"68548bb0","metadata":{"papermill":{"duration":0.024303,"end_time":"2023-06-15T19:38:51.64162","exception":false,"start_time":"2023-06-15T19:38:51.617317","status":"completed"},"tags":[]},"source":["## Conclusion\n","\n","That concludes this first portion of the model. According to my references we were pretty accurate in the strongest predictors of kidney disease, besides diabetes. I chose not to include diabetes as there are a lot of comorbidities that come with a chronic illness and these other features are mostly intervenable besides age. The run time is about to exceed the 1 hour mark on my laptop and now that we have the selected features tapered down into a completed dataset it would be better to move to a new notebook for final feature colinearity check, splitting the dataset into train and test cases, and finally running the actual model predictions. I hope to then build an ensemble out of the cases in a third notebook down the line if the findings seem appropriate and then testing another dataset, processed with mice as well, to check the generalizability of the model. Thank you for reading through this long notebook! If you have any tips or adjustments for my r code or machine learning in general to speed up the run process please share them in the comments!"]},{"cell_type":"markdown","id":"c020af07","metadata":{"papermill":{"duration":0.023988,"end_time":"2023-06-15T19:38:51.689572","exception":false,"start_time":"2023-06-15T19:38:51.665584","status":"completed"},"tags":[]},"source":["## References\n","\n","1. https://wwwn.cdc.gov/nchs/nhanes/search/datapage.aspx?Component=Questionnaire&CycleBeginYear=2013\n","\n","2. https://www.cdc.gov/kidneydisease/publications-resources/kidney-tests.html\n","\n","3. https://www.niddk.nih.gov/health-information/health-statistics/kidney-disease\n","\n","4. https://machinelearningmastery.com/feature-selection-with-the-caret-r-package/"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":1454.919037,"end_time":"2023-06-15T19:38:51.936165","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_pat